import { type } from 'os'
import React from 'react'
import style from './index.module.css'

const Menu = ({ children }) => {
    return (
        <ul className={style.menuList}>{children}</ul>
    )
}

const Item = ({ children }) => {
    // console.log('children..',  children instanceof Array, typeof(children[0]), typeof(children[1]))
    // if(children.l)
    if(children instanceof Array) {
        console.log('first child', children[0].$$typeof, children[0] instanceof HTMLElement)
    }
    return (
        <li className={style.item}>{children}</li>
    )
}

Menu.Item = Item

export default Menu
